INSERT INTO `product` VALUES ('6dfa022df9784e14a4fafe8b23c31a59', 'e1a8be82aa0340a797f1912ef41fdbb5', 'iphone', 6799.00, 6400.00, 18.0, '瓶', 30, 10, 0, 0.0, 0.0, 1, 0, '<p wx:nodeid=\"7\"><b wx:nodeid=\"8\">iPhone</b>是<a wx:nodeid=\"11\">苹果公司</a>研发及销售的<a wx:nodeid=\"14\">智能手机</a>系列，搭载苹果公司研发的<a wx:nodeid=\"17\">iOS移动操作系统</a>。<a wx:nodeid=\"20\">第一代iPhone</a>于2007年1月9日由时任苹果公司<a wx:nodeid=\"23\">CEO史蒂夫·乔布斯</a>发布，并在同年6月29日正式发售。最新发布的iPhone手机是iPhone&nbsp;12系列，包括<a wx:nodeid=\"26\">iPhone&nbsp;12、iPhone&nbsp;12&nbsp;mini</a>、<a wx:nodeid=\"29\">iPhone&nbsp;12&nbsp;Pro以及iPhone&nbsp;12&nbsp;Pro&nbsp;Max</a>，该系列于2020年10月13日正式对外发布。</p><p wx:nodeid=\"32\"><img src=\"https://localhost:8600/Arslinth/uploadimg/iphone 13b6cfca21dedfb93b.jpg\" alt=\"iphone 13\" wx:nodeid=\"33\"></p><p wx:nodeid=\"37\">iPhone运行由苹果公司研发的iOS操作系统（原名iPhone&nbsp;OS），其自带由苹果公司开发的应用程序，并支持通过<a wx:nodeid=\"39\">App&nbsp;Store</a>来下载第三方程序。苹果公司通过在线更新服务或iTunes为iPhone提供免费更新。</p><p wx:nodeid=\"42\"><img src=\"https://localhost:8600/Arslinth/uploadimg/iphone 1393a98aa07ca878d3.jpg\" alt=\"iphone 13\" wx:nodeid=\"43\"></p><p wx:nodeid=\"47\"><b wx:nodeid=\"48\">iPhone&nbsp;3GS的顶部及侧面，外型与iPhone&nbsp;3G相同。从左至右：旁边&nbsp;-&nbsp;唤醒/睡眠按钮、SIM嗔咭插糟、耳机插孔、静音开关、音量控制。顶部&nbsp;-&nbsp;屏幕上的听筒；第一代iPhone的按键使用全黑色塑胶制造。</b></p><p wx:nodeid=\"50\">测试提交</p><p wx:nodeid=\"52\"><img src=\"http://tmp/wxffcef2f04dd04329.o6zAJs8_3c_xA7Bvn-4A4krztGt0.HPt9uvaW8e7Z8a223755c61b7b1651e11e59ba0b903c.jpg\" alt=\"图片\" wx:nodeid=\"135\"></p><p wx:nodeid=\"139\"><br wx:nodeid=\"140\"></p><p wx:nodeid=\"54\">iPhone所采用的多点触控技术以及其友好的使用界面使得该系列产品大获成功，同时也对其他智能手机的设计产生了深远影响。美国时代周刊将iPhone称为“2007年的年度发明”。截止到2020年，iPhone的销量超过了18亿。iPhone的成功使得苹果公司成为全球最有价值的<a wx:nodeid=\"56\">上市公司</a>之一。</p>', '2020-11-09 04:35:49');
