INSERT INTO `update_log` VALUES (1, '2020年05月15日', '第一次使用springboot框架快速搭建项目', '重新学习面向对象的开发模式。重新熟悉springboot的框架结构。');
INSERT INTO `update_log` VALUES (2, '2020年06月20日', '', '完成登入以及权限的验证功能。将前端UI迁移至Layui框架。使用Layui 2.5.6 的一切准备工作似乎都已到位。');
INSERT INTO `update_log` VALUES (3, '2020年07月01日', '', '基本业务已全部添加。开启与业务相关的app编写。');
INSERT INTO `update_log` VALUES (4, '2020年07月16日', '第一次上线云端', '地址：https://chenyi.ink:8600/Arslinth。');
INSERT INTO `update_log` VALUES (5, '2020年07月19日', '', '进货管理->品种信息：修改了品种信息页面样式。');
INSERT INTO `update_log` VALUES (6, '2020年07月20日', '新加了一些页面; 修改了一些权限功能', '增加出货管理的销售数据统计图。系统管理->角色管理：除管理员外新添的角色将不再有增加、编辑、删除等功能。出货管理->销售列表：添加地区显示的管理。');
INSERT INTO `update_log` VALUES (7, '2020年07月29日', '此次仅包含了一些小更新', '网站的访问形式变成https开头，意在提供安全访问的通道。进货管理->进货统计：添加Excel导入功能的说明。出货管理->销售列表：添加根据出售的商品名称的查找方式。');
INSERT INTO `update_log` VALUES (8, '2020年08月03日', '修复了一些逻辑错误，右上角可以更新头像了', '微信小程序可以临时增加品种，点击图片可以查看品种的详细信息了，上传的图片比例建议为4:3。微信小程序可以临时隐藏不必要的品种（列表左滑即可选择）。进货管理->品种信息：新增了快速切换隐藏或显示的功能，新增“性状特征”编辑富文本的功能。');
INSERT INTO `update_log` VALUES (12, '2020年11月10日', '', '添加日志编辑。');
INSERT INTO `update_log` VALUES (13, '2020年12月31日', '2020最后一天', '没什么特别的事情。');
